import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";

import { Nav, Button, Navbar, NavItem, Container } from "react-bootstrap";

function Navigation() {
  const [open, isOpen] = useState(true);

  return (
    <Nav bg="primary" className="navbar navbar-expand-lg navbar-dark bg-transparent"></Nav>
  );
}

export default Navigation;
